(89241, 1, 1, 253, 5, 5, 5, 5, 5, 5, 4, 4, 4, 4, 4, 5, 4, 5, 5, 5, 5, 5, 5, 5, 2, 5, 5, 5, 5, 5, 1, 5, 2, 2, 'hazelcansancio29@gmail.com', 'None', 'Hazel Cansancio', 'BSED ENGLISH', '1/22/2023 21:16'),
(89242, 1, 1, 253, 3, 4, 3, 4, 4, 3, 3, 4, 4, 4, 3, 4, 3, 5, 3, 4, 1, 1, 2, 2, 2, 2, 1, 1, 2, 2, 2, 1, 1, 1, 'cherrylixciousgrace@gmail.com', 'Just to be honest. I dont like how this teacher lead our class. As what we have discussed in our  Profed 3 subject, we tackled about teacher leadership. Teachers are leaders, they exercise leadership in a classroom. They guide, direct, administer and lead a classroom. But in her case, i didnt observe such. She\'s our adviser but she acts like just our subject teacher. I get it that we are already in college but it doesnt mean we dont need a teacher, an adviser. Someone who can direct and guide us towards our journey. To be honest, i am disappointed by how she handled conflicts in our class. She\'s a teacher, she\'s our adviser, she should be the one to help us be unified specially that our class is divided into set. But she\'s not doing the right thing, instead she sometimes make it worst. She never failed to make us feel worthless and making us feel we are always at fault. Her reasons will always be like this \"Dagko namo, college namo. Mo third year nalang mo, di namo miski pa instruckan. Di namo miski pa kasab an. Pagdesisyon mog inyo.\" i mean is that how you would help your students grow? i dont get it. I know that were already in college but Maam Sir, we are still vulnerable and open to a lot of mistakes. Yes were already in college, and we college students needs each of the teachers guidance. I mean, isnt it ironic? we are in the last stage of our education life yet we are treated like the least priority because we are already college students. That mentality is so absurd. No wonder, why Philippines end up like this.Just an honest opinion.', 'Cherry Grace S. Campugan', 'BSED ENGLISH 2B', '1/23/2023 18:33'),
