(94356, 1, 2, 248, 4, 4, 4, 4, 4, 4, 4, 3, 4, 3, 3, 3, 5, 3, 4, 3, 3, 4, 3, 3, 4, 3, 3, 3, 3, 3, 3, 5, 5, 3, 'rosefaithlazanas10@gmail.com', 'This teacher is nice and effective. However, i think she would treat us fairly as she always complain us ( who sit in the front) that we are noisy but in reality we\'re not.', 'Lazanas, Rose Faith J.', 'BSBA 1-A', '4/26/2023 9:45'),
(94357, 1, 2, 248, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 'charisyllerasan54@gmail.com', 'I like her attitude strict but para rasad ni namo, nindot mo tudlo makasabot jud ang students', 'Charisyl B. Lerasan', 'BSBA 1A 1ST YEAR ', '4/26/2023 9:49'),
(94358, 1, 2, 248, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 2, 3, 3, 3, 3, 3, 3, 2, 3, 3, 3, 3, 2, 3, 3, 3, 3, 2, 1, 'glennemaeconcepcion@gmail.com', 'None', 'Glenne Mae A. Concepcion ', '1st year BSBA-HR ', '4/26/2023 9:51'),
(94359, 1, 2, 248, 5, 3, 2, 1, 2, 1, 2, 1, 1, 2, 2, 2, 2, 2, 1, 2, 1, 2, 1, 1, 2, 1, 1, 1, 2, 2, 1, 1, 1, 1, 'shainagomera@gmail.com', 'N/A', 'BSBA 1-A', 'BSBA 1-a', '4/26/2023 9:53'),
(94360, 1, 2, 248, 5, 5, 5, 4, 4, 4, 3, 3, 2, 4, 4, 2, 4, 2, 4, 3, 3, 3, 2, 3, 3, 2, 3, 2, 3, 3, 4, 2, 2, 1, 'kiethabigail10@gmail.com', 'Ms. Raganas is that type of teacher nga ma intimidate ka to enter her class. If ever you will be in my shoes, you\'ll be afraid to speak up your opinions about things kay mahadlok ka nga masuko siya nimo. You really cannot deny the fact that she\'s great in teaching. But she\'s just so strict to her students to the point nga mahadlok naka mo approach niya. I know being strict is a good thing to help students to be disciplined but naa raman siguroy limitations ang mga butang. There are times pud nga she\'ll promise or a drop a specific time to give some activities to us but ang ending is that dili ra siya mahitabo. The students end up waiting minutes or even pila ka hours for the activity but wala ra diay in the end. There\'s this one time pud nga makig meet siya namo through google meet that takes up so much of our time. I understand man pud sa iyahang part nga kuwang rami sa time kay lage once a week rami mag meet but we have our own pud raba nga mga life or business. I do really hope that she\'ll be able to manage her time better next time. Lastly, I do also feel like naa syay favoritism sa iyahang students. Mamili siya ug kinsa siya masuko ug dili. I don\'t know if she\'s meant to do that but that\'s how I feel from her. ', 'Kieth Abigail Mahelom', 'BSBA-1', '4/26/2023 10:03'),
(94361, 1, 2, 248, 4, 5, 3, 4, 4, 3, 3, 2, 2, 3, 3, 4, 3, 3, 4, 2, 3, 3, 3, 3, 4, 3, 3, 3, 3, 3, 2, 3, 3, 3, 'francisaira20@gmail.com', 'In terms of teaching, okay ra kaayo siya mo dalag tudlo kay makasabot rasad ko or kami tanan man. In term sa activity okayÂ² rasad\nkay naa raman sa iyang gi discuss iyang ipa activity. However, when it comes to managing the time, maglisod pa si Miss. Like for example kanang mo hatag siyag activity nga google form, unya nasabotan na nga sa kana nga time i send niya, but dili siya maabot maabtang nalang ug ugma or unsa ba. And I think dili siya magpahibalo nga dili siya ka send, unya na if ever naay mo approach. But mo reason out man pud siya, pero after na dili before the time. Feel man sad gud nako busy kaayo si Miss nga to the point dili kaayo niya na ma manage  ang iyang time kay tungod guro sa kakapoy, maong mo sabot rapud ko. She don\'t like late comers but she also not in class on time. Siguro gituyo rapud na niya so that ang mga late comers naa pay chance mo abot sa room nga wala pa siya. I also observed nga DIRECT TO THE POINT OR MO PRANKA SI miss ug tabi. Actually, it is not bad nga mo pranka,  but maybe control lang pud sa mga sensitive words kay wala ta kahibalo nasakitan sa imong gi sulti. Dili kaayo ko makaingon pud nga approachable si Miss. Kay even me, mahadlok ko mangutana kay basin pilosopo ang tubag ni Miss. So much for that, still very good ang teaching skills ni Miss, naa lang jud times nga dili ka maka uyon sa pamaagi uban. ', 'Aira', 'BSBA 1A', '4/26/2023 13:30'),
